		newMsg.payload.AccelerationZ = parseInt(msg.payload.DevEUI_uplink.payload_hex.substring(i+6,i+8),16);
		i += 8;
		acc = 0;
	}
	else if(caseTest == '0f' && move)
	{
		newMsg.payload.Movement = parseInt(msg.payload.DevEUI_uplink.payload_hex.substring(i+2,i+4),16);
		i += 4;
		move = 0;
	}
    else if(caseTest == "04" && lum)
    {
		newMsg.payload.Light = parseInt(msg.payload.DevEUI_uplink.payload_hex.substring(i+2,i+6),16);
		i += 6;
		lum = 0;
	}
	else if(caseTest == "05" && motion)
    {
		newMsg.payload.Motion = parseInt(msg.payload.DevEUI_uplink.payload_hex.substring(i+2,i+4),16);
		i += 4;
		motion = 0;
	}
    else if(caseTest == "06" && co2)
	{
		newMsg.payload.Co2 = parseInt(msg.payload.DevEUI_uplink.payload_hex.substring(i+2,i+6),16);
		i += 6;
		co2 = 0;
	}
    else if(caseTest == "07" && batt)
	{
		newMsg.payload.Battery = parseInt(msg.payload.DevEUI_uplink.payload_hex.substring(i+2,i+6),16)/1000.0;
		i += 6;
		batt = 0;
    }
	else 
	{
		i += 2;
	}
}

return newMsg;

